[ 1 ] DESCRIPTION :

The goal of this project was about developing a web application to manage everything in a medical clinic, such as :

- Doctors availabilities;
- Patients appointments;
- Patients medical files;
- Promotions;
- Coming events;
- etc...

The project was done by a group of 3 persons. We passed by these steps :

- Collecting and understanding data about medical clinics;
- Designing this data using the "MERISE Modeling Methodology" that proceeds to separate treatment of data and processes, where the data-oriented view is modeled in three stages, from conceptual, logical through to physical;
- Developing the website.

The website's public pages (used by everyone : patients and workers at the clinic) were developed using packages and procedures of PL/SQL, but the administrative part (used by workers at the clinic) was developed using Oracle APEX.

[ 2 ] USED SOFTWARE : Oracle SQL Developer v17.4, Oracle Application Express (APEX), WinDesign

[ 3 ] USED LANGUAGE(S) : PL/SQL Web Toolkit, JQuery, HTML, CSS

[ 4 ] MODELING / PROJECT DESIGN : MERISE

[ 5 ] DATABASE : Oracle

[ 6 ] PROJECT MANAGEMENT METHOD : AGILE

