Le sujet s'appuie sur les modèles de composants du circuit fluidique développés durant les travaux pratiques précédentes.
Le sujet met en pratique la démarche de conception d'un circuit de pilotage individuel d’une micro-pompe destinée à la mise en circulation d’un fluide dans une plaquette d’analyse. 
Le sujet est réalisé sous Cadence.
Le débit du fluide est maintenu constant à l'aide d'une boucle de régulation où un capteur (débitmètre) est inséré dans le circuit fluidique en sortie immédiate de la première micro-pompe.

La conception du circuit de régulation des micro-pompes consiste à faire converger les performances simulées sous Cadence vers les spécifications attendues. Le dimensionnement final des composants internes aux fonctions du circuit nécessite au préalable une analyse du dispositif de régulation sous une description purement comportementale. Les différentes fonctions du circuit de pilotage sont donc dans un premier temps décrites à l'aide du langage Verilog-A compatible avec les outils Cadence. On introduit ensuite progressivement, pour chacune des fonctions, un modèle de description tenant compte de la technologie d'intégration (modèle de type Spectre) sous une vue schematic.

L'étude suit la progression suivante :
• Description comportementale en langage Verilog-A et simulation de chaque bloc du système ;
• Simulation globale du système modélisé en langage Verilog-A;
• Description sous forme de netlist et simulation du bloc driver ;
• Simulation globale du système modélisé en langage Verilog-A avec bloc driver décrit par sa netlist;
• Description sous forme de masques (layout) et simulation du bloc driver ;
• Simulation globale du système modélisé en langage Verilog-A avec bloc driver décrit par son
layout;
